def find_lexmin(vars, constraint_generator):
    assigned = {}
    for i in range(len(vars)):
        var_name, var_lo, var_hi = vars[i]

        for n in range(var_lo, var_hi + 1):
            solver = Solver()
            v = {key: solver.int_var(lo, hi) for key, lo, hi in vars}
            constraint_generator(solver, v)
            for key, val in assigned.items():
                solver.ensure(v[key] == val)
            solver.ensure(v[var_name] == n)

            if solver.find_answer():
                assigned[var_name] = n
                break
            else:
                continue
        else:
            assert False

